pred:
 The unit structures of PolyAI can be represented as follows:

* monolayer represents single-walled nanostructures, e.g. film, sheet, bubble, bulge, pseudotube, pseudofilm and pseudosheet;
* bulk and bilayer represent inner and outer walls of multi-walled nanostructures, e.g. bottle, separating-finger-like-bulk and pseudoballoon;
